import 'bulma/css/bulma.css';
import _ from 'underscore'

const App = () => {
  return (

    <section className="hero is-primary">
  <div className="hero-body">
    <div className="container">
      <h1 className="title">
        Primary title
      </h1>
      <h2 class="subtitle">
        Primary subtitle
      </h2>
    </div>
  </div>
</section>
  )
  }

export default App;
